-11-18 06:27:17','2025-11-18 06:28:08'),('c8a0eee6-d597-48c3-b1ad-51c0f28bb1b7','4af19f47-c436-11f0-b163-525400735d47',4,3,1,2,0,20,NULL,'completed','2025-11-18 04:27:15','2025-11-18 04:29:05'),('cec67950-ad6b-4603-a4b2-3b3fe65b85d6','4af19f47-c436-11f0-b163-525400735d47',1,0,1,0,1,20,NULL,'completed','2025-11-18 04:24:04','2025-11-18 04:28:42'),('cefbb687-5cb4-46d3-ae5e-349e45a98767','3f2c0475-c443-11f0-b163-525400735d47',3,2,3,0,1,20,NULL,'completed','2025-11-18 06:01:56','2025-11-20 02:10:59'),('d4d799b3-aaae-4069-b4bd-797b19b7ea1c','3b05c8af-c4a8-47a4-a789-15d5c63ffc3d',1,2,5,0,1,20,'第一节2比5。\n深秋+雨是个很来瞌睡的时节，但是大家还是热情高涨的报名了一大堆堆。嘉陵摩托到场队员；球霸，101，木头哥，海瑞，猴儿，塑料门，施驿，杨涛，黄波，牛仔裤。长江黄河到场队员；小黑，福子，曹老板，邱帅，猫儿，李强，黄鑫，戴壮，然哥，阿尔恒，罗阳，小房，刘柯良，严帅。（还有两个家属不知道谁的）\n  第一节双方拉开对攻，长江队青年军冲击力明显强大一些，嘉陵防线被冲溃，长江很快取得3/0优势。嘉陵快速调整打法，加紧了中场防守，双方第一节最后十分钟打得有来有回各进两球。长江队5/2赢下第一节。\n','completed','2025-11-22 04:18:44','2025-11-23 13:12:01'),('d5bd05b4-c930-423d-8549-87b8b7429dde','3f2c0475-c443-11f0-b163-525400735d47',1,2,2,0,0,20,NULL,'completed','2025-11-18 05:56:52','2025-11-18 05:58:56'),('dbba0a61-398e-4370-88d2-8eda028632ff','5cb22fa6-c432-11f0-b163-525400735d47',4,1,0,2,0,20,NULL,'completed','2025-11-18 03:59:06','2025-11-20 01:55:48'),('dc5cc876-302f-43c2-9ac9-75fb998bf6ec','5514dd79-c447-11f0-b163-525400735d47',1,1,0,1,0,20,NULL,'completed','2025-11-18 06:25:50','2025-11-18 06:25:52'),('df2c1bed-5a4b-4b68-af85-81ea0a879a62','5514dd79-c447-11f0-b163-525400735d47',4,2,2,0,0,20,NULL,'completed','2025-11-18 06:28:25','2025-11-18 06:29:57'),('e002601a-8631-4b2d-aaee-3160dc58a384','b474ed84-c440-11f0-b163-525400735d47',3,1,2,0,1,20,NULL,'completed','2025-11-18 05:40:55','2025-11-18 06:11:09'),('f2f1fcde-7aa3-4ead-9745-eb7e041df0b2','4c78f684-c439-11f0-b163-525400735d47',1,3,1,1,0,20,NULL,'completed','2025-11-18 04:46:34','2025-11-18 04:55:55');
