INSERT INTO `match_results` VALUES ('00da5582-176a-470a-a4b1-e1a9dd97e5ae','5cb22fa6-c432-11f0-b163-525400735d47',3,2,'b6ab3e9b-7bd7-468f-ae54-51c7675831e3',0,NULL,NULL,NULL,'[\"6a1ea615-5f87-4e6a-bc3a-214ee9a48646\", \"78e6a8de-20dc-4560-b567-a054b04237b5\"]',NULL,'柳真丘科的配合\n9月27日，两江超级联赛第二轮，比分:3:2。嘉陵江获胜。\n到场人员：\n花：黄波，王鑫，101，骆地生，杨涛，陈然，永健，邱帅，老马，陈佳。\n红：丘科，柳真，徐翔，杨文华，木头，海瑞，廖鹏小兄弟，安雄，洪胜。\n第一节0:2，第二节4:1，第三节0:2，第四节3:2。\n第一节红队门将出击失误，被永健远射，红队丘科躲在阴凉坝，作用不大。最后又被进了一个。\n第二节柳黑和丘科在前场，二筒守门，很快打开了，先后防失误被花队进了一个，但是连续扳了好几个，主要是柳黑丘科和洪胜的配合。\n第三节双方互有攻防，最后时刻骆地生搞了个一条龙。\n第四节大家体力透支，咬牙坚持，洪胜最后一个一条龙奠定胜局。\n渝超赛期出场阵容以老头乐为主，祝大家国庆假期快乐\n数据:丘科3球2助1门、陈然1球1裁、洪胜3球1助、永健1球3裁、杨涛3门、柳真1球、王凌云4助、马培才1助、邱帅1球、王鑫1球。\n第四节更正一下，红队后卫出球失误被王鑫拦截，后者远射进球，然后洪胜在两大高手挡拆下进入禁区得分。骆地生一条龙长途奔袭得分。最后剩7分钟时，红队连进两球绝杀，丘科角球助攻外援头球，然后丘科反击助攻插上的洪胜射门。','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-20 01:56:10',1,3,2,3,3,NULL,0),('0f7591b3-6c6d-47e9-a985-18c6b16fb2eb','4c78f684-c439-11f0-b163-525400735d47',7,1,'b6ab3e9b-7bd7-468f-ae54-51c7675831e3',0,NULL,NULL,NULL,'[\"7fbeef0d-dd93-457b-a259-16e869430e28\", \"277dc273-6b68-4d68-8414-3f2672278a6e\", \"8cf4f261-5ddb-446b-9064-dacbe9c59f1f\", \"21a35430-9b03-4adf-9ac1-be66f1aad476\"]',NULL,'洪胜4球 嘉陵4连胜\n10月12日，两江超级联赛第四轮，比分:3:0，嘉陵江获胜。\n到场人员：\n花：小黑、曹枫、张潮、夏雷雨、戴壮、王海涛、黑儒学、陈然。\n红：黄波、施毅、洪胜、王鑫、木头、培才、史地、刘立希、银河、杨涛、徐翔、海川。\n第一节嘉陵江边后卫小刘远射，小黑守门猝不及防，首开纪录。长江队利用嘉陵江防守松懈扳平。小黑解放后几个二过一后，打门反超。洪胜突进禁区打门将大黑小门，再扳平。木头最后关门得到洪胜助攻反插进禁区，把比分定格3:2。\n第二节川哥、二筒上场，银河黄波木头休息。洪胜打门在对方后卫身上折射进门，门将永健无可奈何，花队在夏雷雨和小黑及其发小的前场流畅传切下，将比分反超，夏雷雨打进一球。二筒在场下大叫“不会传球”时，下底传出好球，洪胜推射进。2比2。\n第三节，川哥继续冲刺。夏雷雨反越位奔袭打进一个死角，1比0，眼看就要赢球时，王鑫驰援，替下黄波后策动进攻，门前混战中川哥把球打进。1比1。\n第四节决战，花队由于只有1个替补（红队4个），体力下降明显，夏雷雨回到后腰处体力已经大不如前。嘉陵江占据优势，银河突破后下底传中，洪胜推射进，永健碰到但差一点。1比0。长江队角球被打出后，洪胜得球传另一侧空出的黄波，后者带球在禁区边推进远门柱。2比0。','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-18 04:57:06',1,3,0,8,4,NULL,0),('137a23d3-b11e-4bc3-8cb9-3304ce115a94','3b05c8af-c4a8-47a4-a789-15d5c63ffc3d',6,9,'281a79c2-e10a-4bfa-8dc8-def0b7b7580a',0,NULL,NULL,NULL,'[\"8cf4f261-5ddb-446b-9064-dacbe9c59f1f\", \"6a1ea615-5f87-4e6a-bc3a-214ee9a48646\", \"180d92e2-5a13-450e-97ea-9e19283c860b\", \"84e2f056-3854-41e6-9941-25f9a428fcda\"]',NULL,'日期11月22日  小雪\n本场比分1：3。第一节2比5。第二节3比1。第三节1比1，第四节0/3。长江黄河终于没有江河日下（猫儿提议改名叫蒸蒸，他们不干）\n深秋+雨是个很来瞌睡的时节，但是大家还是热情高涨的报名了一大堆堆。嘉陵摩托到场队员；球霸，101，木头哥，海瑞，猴儿，塑料门，施驿，杨涛，黄波，牛仔裤。长江黄河到场队员；小黑，福子，曹老板，邱帅，猫儿，李强，黄鑫，戴壮，然哥，阿尔恒，罗阳，小房，刘柯良，严帅。（还有两个家属不知道谁的）\n  第一节双方拉开对攻，长江队青年军冲击力明显强大一些，嘉陵防线被冲溃，长江很快取得3/0优势。嘉陵快速调整打法，加紧了中场防守，双方第一节最后十分钟打得有来有回各进两球。长江队5/2赢下第一节。\n第二节嘉陵队应该是商量敲定了防反的老战术，虽然长江攻势依然不减，但收获寥寥，反而是嘉陵队的打法简单快捷，大禁区附近有机会便开炮，牛仔裤和杨涛都取得了进球，球霸也打进一颗补射点球，而这个点球也是来源于射门球反弹造成的手球，第二节嘉陵队以3/1拿下。（所以男人还是要多射，射才有机会）\n第三节长江队也不敢轻敌了，扎紧了中路防守，小房和福子退回半场司职中后卫和后腰，阿尔恒串联前场。这一节双方都拿出了浑身解数，阿尔恒的盘带和传球均被嘉陵队的密集阵防住，但场上两个老头反而被忽视了，曹老板接猫儿斜传球杀到大禁区无人区，虽然被补防人员拦截，但还是鼓捣搞了出来，戴壮接球打远角进。落后一球的嘉陵队没有泄气，抓住机会大举进攻，长江队欲造越位但忽视了后插上的对手，被下底横传点球点扫射。比分1/1进入最后一节。\n  决胜节谁赢谁吃面，但是长江队的青年军要集体赶车回梁平参加渝超，剩下刚好八人+场外裁判然哥。嘉陵队不可能放过这个大好机会想要先取得进球占据优势，长江队根据人员情况果断调整整容，让小黑顶中后卫，福子后腰策应，顶住了嘉陵队前面几轮攻势，嘉陵队取得的几次任意球机会也未能打出高质量配合。长江队这时候由福子开启导弹战术，连续四次尝试吊门后终于抓住塑料门一个反向，吊进一球。落后的嘉陵队只能被迫加大进攻力度，但黑福一高一块的防守始终难以突破，反而是自己边路的空挡越来越大，又被打进两粒。本节结束长江3球完胜。\n本场数据：\n洪胜1球2助\n福子1球\n猫儿2门（战报）\n戴壮3球1助\n杨涛1球\n曹枫1球1助\n王凌云1球2助\n黄鑫1球\n严帅2门\n小房1助\n木头1球1助','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-23 13:12:39',1,1,3,6,9,NULL,0),('8d7ea9c2-8c72-4d13-bccc-a6ed2adc3cd9','4af19f47-c436-11f0-b163-525400735d47',9,5,'b6ab3e9b-7bd7-468f-ae54-51c7675831e3',0,NULL,NULL,NULL,'[\"003d0cec-2665-4655-82aa-198784fd2886\", \"9c0ccbee-c7a4-4da5-9147-7e117f9eb16a\", \"37a97715-d228-479b-a032-e04e24b43ae7\", \"180d92e2-5a13-450e-97ea-9e19283c860b\"]',NULL,'何锐复出助嘉陵\n10月8日，两江超级联赛第三轮，长江1:4嘉陵江。地点：国博体育场。\n到场人员：李强，福子，曹枫，戴壮，陈然，邱帅，陈奇，剑桥，洪胜，王凌云，施毅，木头，刘立希，孔祥宇，马培才，黄波，史地，海川，何锐。\n嘉陵江队除了一节丢了3个连追2个告负外，其他三节全胜。\n101换装加入长江队，担当中场核心。福子在后场的调度非常精准，可惜陈先锋浪费了福子几个助攻，门前多次离奇不进。曹老板效率好多了，边路两脚打门进了两个，发任意球还有模有样很在线。戴壮从门将解放出来，担当了攻城锤角色，和福子冲吊连线，多次进球。但是在与小孔拼速度时例外。何锐复出，先从门将开始，曾经吓飞陈然射门，然后打边路，很有灵性的传中让川哥吃饼。剑桥是当场最大mvp，几次打进高难度进球，当然，打完后摔还是摔了。和猫儿的矛盾之争肯定占了上风，但是猫儿不仅用胳膊攻击了剑桥眼睛（无意的），还用慢节奏的出腿踢了剑桥小腿（无心的），最后用护腿板当成飞镖（手滑了）。洪胜打进剑桥造的点球，助攻史地进了一球。因为小孔的归属，两边争了一整场。','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-18 04:30:43',1,4,1,9,5,NULL,0),('a9259e6a-41c1-4ab5-be91-ed74694188c6','aa3eb715-c42e-11f0-b163-525400735d47',5,2,'b6ab3e9b-7bd7-468f-ae54-51c7675831e3',0,NULL,NULL,NULL,'[\"d2f05391-e6e4-4109-a0ef-47631700cb69\", \"8cf4f261-5ddb-446b-9064-dacbe9c59f1f\", \"370f143c-17fe-4df4-b2d6-f75ed4a97a99\", \"7dda9b5f-62ca-4e98-a44d-943cb982c684\"]',NULL,'两江超级联赛开锣\n9月20日，第九季红牛对抗赛暨第一届两江超级联赛第①场。由曾鹏率领的嘉陵摩托（红）对阵由李强带队的长江黄河（花）。\n到场人员：李洪胜，刘丘科，木头，施毅，老马，杨涛，黄波，杨文华，海川，黑子，小黑，小房，罗阳，李阳，邱帅，曹老板，陈然，戴状，王海涛，蒲海瑞，廖鹏朋友，曾鹏朋友。\n第一节杨涛海瑞资敌，对方先是一个吊射中门框弹下又弹上，到底过没过线成为悬案。但是裁判海川认为进了。摩托压上，又被偷了一个，0比2结束。\n第二节罗阳利用守门员的不当出击，在杨涛防守下禁区外推射打进。最后一秒，海川接丘科角球，头球扳平，1比1。\n第三节到了木头发挥时间，先是左路带球20多米斜射进门（真是让浪费机会的一众“球星”汗颜），然后和施毅打出经典直塞反插，巧射又进一个，梅开二度2比0。\n第四节焦灼，在洪胜被木头换下后。先是杨涛头球扭转局势，最后我方大举压上，木头压哨决定胜局第四节。','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-18 03:35:44',1,3,1,5,2,NULL,0),('b3e7776a-3aa4-4663-b8fe-4cd11fa68c39','fed55d17-c43b-11f0-b163-525400735d47',4,5,'b6ab3e9b-7bd7-468f-ae54-51c7675831e3',0,NULL,NULL,NULL,'[\"21a35430-9b03-4adf-9ac1-be66f1aad476\", \"84e2f056-3854-41e6-9941-25f9a428fcda\", \"7dda9b5f-62ca-4e98-a44d-943cb982c684\", \"180d92e2-5a13-450e-97ea-9e19283c860b\"]',NULL,'黑子当裁判头很大\n10月25日，两江超级联赛第四轮，比分:3:2，嘉陵江获胜。\n到场人员：花：曹枫、福子、小黑、戴壮、黄鑫、罗阳、李云鹏、黑子、猴儿。\n红：黄波、洪胜、施毅、王鑫、杨涛、木头、刘立希、门将杨鹏、杨文华、马培才、猴儿、王凌云、海川。双方各有一个猴儿。\n战况:\n第一节101和毒瘤两翼齐飞，奇怪的是花队给了很多空档给他俩。毒瘤多次传中失败，但是101的突破经过木头回做，由洪胜打进。福子多次必进球被杨涛扑出。第一节嘉陵江1:0胜。\n第二节长江队经过调整，攻势很有起色，先是福子利用猴儿上抢失误，终于推进。节末红队压上，花队戴壮反击，由罗阳打进。第二节长江2:0胜。\n第三节海川一开场就利用小刘突破造成的点球打进。但是胜果没有保住，尤其最后阶段红队一个反击，海川一脚绊倒两人，造成任意球走戴壮在后场吊射，门将杨鹏急忙回跑，已经来不及了，最终靠这个球长江2:1胜。\n第四节云鹏忍耐不住上场，嘉陵江被压制，只能反击，但是小黑几次打门没进。按情况红队该有运气了，果然对方后防几次传球失误，虽然洪胜两次打偏一次打中门柱，没有把施毅的助攻转化，但是木头的打死角，施毅的断球远射，让嘉陵江2:0领先。最后关头，裁判黑子多次懵逼，被场下噪音搞得多次反复。嘉陵江坚守，最终丢了1球，2:1守住胜果。','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-20 02:05:51',1,3,2,4,5,NULL,0),('dc2752a9-0e1e-47f9-9baa-e0d88774fcc2','3f2c0475-c443-11f0-b163-525400735d47',9,5,'b6ab3e9b-7bd7-468f-ae54-51c7675831e3',0,NULL,NULL,NULL,'[\"84e2f056-3854-41e6-9941-25f9a428fcda\", \"21a35430-9b03-4adf-9ac1-be66f1aad476\", \"9c0ccbee-c7a4-4da5-9147-7e117f9eb16a\", \"7dda9b5f-62ca-4e98-a44d-943cb982c684\"]',NULL,'福子最好别守门\n11月8日，两江超级联赛第六轮，比分:3:2。嘉陵江获胜。\n到场人员：\n花：曹枫，福子，阿尔恒，罗阳，聂子覃，福子带的两个小孩儿，猫儿，王鑫（借）。\n红： 杨涛，施毅，101，海川，杨文华，洪胜，黄波，木头，刘立希，史地，海瑞。\n战况：长江今天阵容非常强，不过正好8个，为后面留下伏笔。开场渝超主力后卫组合，加上阿尔恒调度，罗阳攻坚，边路小孩儿快插，很快撕破了嘉陵江防线。由罗阳打进1球，嘉陵江利用241阵型，边路小刘和101，中路杨文华和杨涛，中间洪胜和施毅，海川突前。花队打得红队几乎前20分钟几乎没有进攻，很快长江又进1球。2比0领先。这时，嘉陵江稳扎稳打，先是海川回做洪胜远射打进死角，2比1，本节最后一刻小刘远射打进，嘉陵江绝平。2比2。\n第二节花队保持阵容，只是福子守门。红队轮换，木头、黄波、海瑞、史地换下洪胜、海川、毒瘤和小刘。福子开场送大礼，误判让海瑞传中进门，接着门前混战，嘉陵江再进1球。红队顽强扳回1球后，木头打进1球，嘉陵江3比1领先。最后双方各进1球，4比2嘉陵江胜。\n第三节王鑫加入对方，替换先走的罗阳。红队中卫是杨文华和木头。花队志在必胜，福子授意前锋加大力度，花队连进3球，而红队坚决不放弃，先是洪胜突破后传海川推进，接着节末再进1个。长江3比2胜。\n第四节决战。101传中，洪胜抽射打高，遗憾错失。很快小聂头球砸进，长江1比0领先。不过幸运星木头发威，禁区外推射扳平。嘉陵江乘胜追击，洪胜接小刘左路倒三角，打进世界波。2比1。施毅反击再进，3比1。虽然福子后来插上，扳回1球，但是红队海瑞替下黄波，继续保持防守强队。拿下比赛。','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-20 02:11:03',1,3,1,11,6,NULL,0),('e8559ad7-073b-4941-bd89-6e45bc365ba0','b474ed84-c440-11f0-b163-525400735d47',7,8,'281a79c2-e10a-4bfa-8dc8-def0b7b7580a',1,1,3,'281a79c2-e10a-4bfa-8dc8-def0b7b7580a','[\"9c0ccbee-c7a4-4da5-9147-7e117f9eb16a\", \"8cf4f261-5ddb-446b-9064-dacbe9c59f1f\", \"84e2f056-3854-41e6-9941-25f9a428fcda\", \"d2f05391-e6e4-4109-a0ef-47631700cb69\"]',NULL,'小孩儿哥很管用\n11月1日，两江超级联赛第五轮，第一节1比1，第二节1比0，第三节5比1，第四节4比5（长江在前），点球3比1。\n到场队员：\n长江：李强，云鹏，福子，小黑，曹枫，猫儿，邱帅，小张欣，小福子。\n嘉陵：杨涛，木头，101，海川，杨文华，黄波父子，海瑞，洪胜，史地，猴儿。\n福子带来了两个东川7中的高二球员，确实专业，水平很高。\n第一节开场101倒三角，洪胜禁区外打进，杨涛多次扑救，最后关头云鹏打进扳平。\n第二节开场花队先声夺人，禁区外推死角，并把比分保持到最后。嘉陵江也有机会扳平，洪胜传中川哥顶偏，更离谱的是后来史地门前半米没推进（走路撞进去也可以啊！），推到另外一边去了。\n第三节猴儿休息，对方俩高中生发力，很快打了嘉陵江一个4比0，黄波推射挽回颜面，长江小黑打进，最后5比1领先2个局分进入第四节。\n第四节云鹏守门，曹老板休息，福子上来，俩高中生打后面。这给了嘉陵江机会，先是101进球，接着杨文华做球，木头中路推进，嘉陵江2球领先。长江把高中生前移，利用木头传球失误打进1球，1比2。但是木头很快将功补过，后场吊射云鹏，进了！1比3。后面10分钟高中生们彻底打开，加上福子也在中场吊射杨涛进球，把比分反超到了4比3，眼看就要胜利到手。但是先是木头再进一球，上演帽子戏法，4比4。最后一分钟，川哥中场顶住福子，球顶给洪胜，猫儿不小心漏过，洪胜得球面对出击的云鹏推远角，4比5。嘉陵江绝杀进入点球。点球中嘉陵江101、海瑞、海川和长江一个高中生打飞，嘉陵江惜败。','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-20 11:04:18',1,2,2,7,8,NULL,0),('fc838777-f729-4583-9eba-bd2db23c2197','5514dd79-c447-11f0-b163-525400735d47',5,6,'b6ab3e9b-7bd7-468f-ae54-51c7675831e3',1,5,4,'b6ab3e9b-7bd7-468f-ae54-51c7675831e3','[\"003d0cec-2665-4655-82aa-198784fd2886\", \"fe6aebef-6f31-4cc1-baa0-4131c267d5f8\"]',NULL,'长江v.s嘉陵江。第一节0比1，第二节2比0，第三节2比2，第四节2比2。点球4比5。\n长江队员：李强，曹枫，云鹏，丁丁，陈然，黄展，小黑，小黑朋友，永健。\n嘉陵球员：银河，丘科，海川，杨涛，猴儿，王鑫，101，黄波父子，海瑞，木头，洪胜，杨鹏。\n第一节丁丁多次喂球云鹏，云鹏两次空门拌蒜，丁丁不禁埋怨“应该让小鹏哥回来打门将”，此处小黑表示同意。黄展看不下去，让云鹏和自己换个位置。红队几乎让长江形不成进攻，但是威胁机会也几乎没有，最后木头一个神仙球打进，1球小胜。小刘表现亮眼。\n第二节海川、101、黄波、银河替换木头、海瑞、小刘等上场。前场多次掉球造成被长江反击，终于被黄展抓住机会，一脚远射打进，这球是边路打得近角，守门员很懊悔。最后云鹏又抓住一次反击打进，2比0长江拿下胜利，大比分拉平。\n第三节很戏剧，黄展很快远射打进1球，银河以及后面换上的剑桥，包括木头/101，总之就是各种打不进。中后卫杨涛看不下去了，上去抡了一脚，远射打进扳平。紧接着黄展又过了门将后进球领先，比赛已经接近尾声，杨涛再次上前，自己传球自己接应，卧射打进，2比2。\n第四节，丘科和王鑫睡醒了，都上了场。丘科两次调度剑桥，剑桥都是卡住身位，在左路斜射打进，嘉陵江2比0领先。还剩7分钟，小黑多次突破海瑞，解放后确实不一样。两次倒三角，云鹏突然醒悟，两次把握住机会打进，2比2平。最后一刻，杨涛再次插上，接到洪胜传球，一脚捅射，又快又平，可惜被门将李强扑出，差点又当英雄。哨响，进入点球。\n第一轮嘉陵江小黄打丢，后面剑桥，丘科，猴儿都打进。长江丁丁，曹枫，外援和小黑也打进。黄展最后罚，只要打进就赢，全场mvp的呼声下，他踢偏，接着洪胜打进（打到门柱弹回到黄展身上又弹回网窝），前五轮又平。第六轮李强打丢，王鑫踢进。嘉陵江在一场极其焦灼的比赛中获胜。','942b0614-06e4-4e35-acd8-52f806a9a5c7','2025-11-20 02:06:11',1,1,1,5,6,NULL,0);
